void ModeGuided::allocate_control(bool useFF) {
    // Get the current state of the drone
    VectorN<float, 26> state = getStateAHRS();
    // Evaluate the neural network policy to get the control outputs
    VectorN<float, 12> nn_output = networkEvaluate(state);
    // Set the control outputs to the actuators
    for (int i = 0; i < 4; i++) {
        // Set the thrust for the 4 propellers (0 to 1 range)
        motors->set_actuator(i, nn_output[i]);
    }
    for (int i = 4; i < 12; i++) {
        //adjusted_output[i] = nn_output[i] + ((i % 2 == 0) ? -M_PI_4 : M_PI_4);
        //adjusted_output[i] = clip(adjusted_output[i], -M_PI_2, M_PI_2);
        motors->set_actuator(i, nn_output[i]);
    }

    // Update raw tilt angles for later use
    for (int i = 0; i < 8; i++) {
        raw_tilt_angles[i] = nn_output[4 + i]; // Tilt angles from the neural network output
    }
}

VectorN<float, 12> ModeGuided::networkEvaluate(VectorN<float, 26>& state_array) {
    // First hidden layer
    for (int i = 0; i < structure[0][1]; i++) {
        output_0[i] = 0;
        for (int j = 0; j < structure[0][0]; j++) {
            output_0[i] += state_array[j] * layer_0_weight[i][j];
        }
        output_0[i] += layer_0_bias[i];
        output_0[i] = relu(output_0[i]);
    }
  
    // Second hidden layer
    for (int i = 0; i < structure[1][1]; i++) {
        output_1[i] = 0;
        for (int j = 0; j < structure[1][0]; j++) {
            output_1[i] += output_0[j] * layer_1_weight[i][j];
        }
        output_1[i] += layer_1_bias[i];
        output_1[i] = relu(output_1[i]);
    }

    // Output layer
    for (int i = 0; i < structure[2][1]; i++) {
        output_2[i] = 0;
        for (int j = 0; j < structure[2][0]; j++) {
            output_2[i] += output_1[j] * layer_2_weight[i][j];
        }
        output_2[i] += layer_2_bias[i];
        // No activation function is applied in the output layer
    }

    VectorN<float, 12> control;
    // Assign the output to the control structure
    for (int i = 0; i < 4; i++) {
        control[i] = scale(clip(output_2[i], -1.0, 1.0)); // Prop control inputs (0 to 1)
    }
    for (int i = 4; i < 12; i++) {
        control[i] = clip(output_2[i], -1.0, 1.0); // Tilt angles (-1 to 1)
    }
    return control;
}



float ModeGuided::relu(float num) {
	if (num > 0) {
		return num;
	} else {
		return 0;
	}
}

// range of action -1 ... 1, need to scale to range 0 .. 1
float ModeGuided::scale(float v) {
	return 0.5f * (v + 1);
}

float ModeGuided::clip(float v, float min, float max) {
	if (v < min) return min;
	if (v > max) return max;
	return v;
}

